import React from 'react'
import {makeStyles} from '@material-ui/core/styles'
import {Typography, Tab, Tabs, Grid} from '@material-ui/core'
import ProjectCard from './ProjectCard'
import Container from '../muiComponent/Container'



const useStyles = makeStyles(theme => ({
  root: {
    background: theme.palette.type === "light" ? "green" : theme.palette.background.dark,
    // padding: theme.spacing(2),
    marginBottom: theme.spacing(10)
  },
  MuiTabsFlexContainer: {
    centered: true,
    variant: 'fullWidth'
  }
}))



function Projects() {
  const classes = useStyles()
  const [currentTab, setCurrentTab] = React.useState(0)

  return (
    <Container id="projects">
      <Typography variant="h3">Projects</Typography>
      <Tabs value={currentTab} centered variant='standard' onChange={(e, value) => setCurrentTab(value)}>
        <Tab label="All" />
        <Tab label="React" />
        <Tab label="Django" />
        <Tab label="java" />
      </Tabs>
      <Grid container justify="center">
        <ProjectCard />
        <ProjectCard />
        <ProjectCard />
        <ProjectCard />
      </Grid>

    </Container>
  )
}

export default Projects
